import { Box } from "@chakra-ui/react";
import NavBar from "../components/Navigasi";
import Footer from "../components/Footer";


const About = () => {
    
    return(
        <>
        <NavBar/>
        <Box h={"100vh"} bgColor={"#F5F7FA"} bgSize={"cover"}>

        </Box>   
        <Footer/> 
        </>
    )
};

export default About;
